import React, { Component } from "react";
class Home extends Component {
  state = {};
  render() {
    return (
      <div>
        <center>
          <h1>Home</h1>
          <button
            className="ui primary button"
            onClick={() => this.handleNavigation("Login")}>
            <p>Login</p>
          </button>
          <button
            className="registerBtn"
            onClick={() => this.handleNavigation("Register")}>
            <p>Register</p>
          </button>
        </center>
      </div>
    );
  }
}

export default Home;
